/** 
 * The `BrushType` enum describes what kind of brush is used for dynamic extrusion.
 * @property HEXAGON Indicates the hexagon brush type.
 * @property FLAT Indicates the flat brush type.
 * @property TRIANGLE Indicates the triangle brush type.
 * @property QUAD Indicates the quad brush type.
 */ 
declare interface BrushType{ 
HEXAGON, 
FLAT, 
TRIANGLE, 
QUAD, 
} 
